import { Component, HostListener, ViewChild, OnInit, OnDestroy } from '@angular/core';
import { DomSanitizer } from '@angular/platform-browser';


@Component({
    selector: 'app-index',
    templateUrl: './index.component.html',
    styleUrls: ['./index.component.css']
})


export class IndexComponent implements OnInit  {

    @ViewChild('headerContainer') headerContainer;
    title = 'Taxicity';
    headerHeight;
    heightw = window.innerHeight;
    widthw = window.innerWidth;
    logosTop = 0;
    videoHeader = '././assets/video/header.mp4';

    constructor(public DomSanitizer: DomSanitizer){}

    ngOnInit() {
        this.headerHeight = this.headerContainer.nativeElement.offsetHeight;
        this.logosTop = this.calcularTopH();
        setTimeout(()=> {
            this.headerHeight = this.headerContainer.nativeElement.offsetHeight;
            this.logosTop = this.calcularTopH()
            console.log("2OI:"+ this.headerHeight + " * " + this.logosTop);
        }, 1); 
    }

    calcularTopH(){
        return ((this.heightw/2)-(this.headerHeight/2));
    }
    
    @HostListener('window:resize', ['$event'])
    onResize(event){
        console.log("host listener");
        this.headerHeight = this.headerContainer.nativeElement.offsetHeight;
        this.heightw = window.innerHeight;
        this.widthw = window.innerWidth;
        this.logosTop = this.calcularTopH();
    }

    

// Imagenes de los logos base64
    logo = 'data:image/png;base64,';

  logoPlayG = 'data:image/svg+xml;base64,';

  logoAppS= 'data:image/svg+xml;base64,';
    
  


}

